import React from "react";
import styles from "./MainPage.module.css"; // Импортируем стили

function MainPage() {
  return (
    <div className={styles.container}>
      <img id="main_img" src="/static/img/14SE.gif" alt="main_gif" />
      <h3>Ищете стабильный и быстрый интернет? IS-COM предоставляет качественные интернет-услуги для дома и бизнеса!</h3>
      <a href="/services">
        <h2>Наши услуги</h2>
      </a>
      <a href="/applications">
        <h2>Заявки на подключение</h2>
      </a>
    </div>
  );
}

export default MainPage;
